import AppInfo from '../app-info/app-info';
import SearchPanel from '../search-panel/search-panel';
import AppFilter from '../app-filter/app-filter';
import MusiciansList from '../musicians-list/musicians-list';
import MusiciansAddForm from '../musicians-add-form/musicians-add-form';

import './app.css';

function App() {

    const data = [
        {name: "Ozzy Crazytrainov", salary: 800, increase: true},
        {name: "Tony Doomov", salary: 3000, increase: true},
        {name: "Bill Urod", salary: 5000, increase: false}
    ];

    return(
        <div className="app">
            <AppInfo/>

            <div className="search-panel">
                <SearchPanel/>
                <AppFilter/>
            </div>

            <MusiciansList data={data}/>
            <MusiciansAddForm/>
        </div>
    );
}

export default App;
